import React from "react";

const Dashboard = () => {
  return (
    <div className="d-flex min-vh-100 bg-dark text-light">
      {/* Left side (Search Box) */}
      <div className="bg-secondary border-end border-1 border-dark p-4" style={{ width: "300px" }}>
        <h3>Search</h3>
        <input
          type="text"
          placeholder="Type to search..."
          className="form-control bg-dark text-light border-secondary rounded"
        />
      </div>

      {/* Right side (Main Content) */}
      <div className="flex-grow-1 p-5 d-flex flex-column gap-4" style={{ backgroundColor: '#181818' }}>
        <h2>Dashboard </h2>
        <div className="bg-secondary rounded p-4 shadow-sm text-light">
          <h4>Heading inside box</h4>
          <p>ABCDEFGHIJKLMNOPQRSTUVZXYZ</p>
        </div>
        {/* Add more boxes if needed */}
      </div>
    </div>
  );
};

export default Dashboard;
